import React from 'react';

let Users = (props) => {
    return (
        <section>
            <h2>{props.h}</h2>
                {props.users.map( u => <div key={u.id}>
                    <span>
                        <img src={u.photoUrl} alt="ava"/>
                        <button>Follow</button>
                    </span>
                    <span>
                        <b>{u.fullName}</b>
                        <p>{u.status}</p>
                        <span>{u.location.city}</span>
                        <span>{u.location.country}</span>
                    </span>
                </div>)}
        </section>
    )
}

export default Users;
